package com.ufgov.zc.server.zc.publish.impl;import java.util.List;import com.ufgov.zc.common.system.RequestMeta;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.common.zc.model.ZcEbOptions;import com.ufgov.zc.common.zc.publish.IZcEbOptionsServiceDelegate;import com.ufgov.zc.server.zc.service.IZcEbOptionsService;public class ZcEbOptionsServiceDelegate implements IZcEbOptionsServiceDelegate {  private IZcEbOptionsService zcEbOptionsService;  public IZcEbOptionsService getZcEbOptionsService() {    return zcEbOptionsService;  }  public void setZcEbOptionsService(IZcEbOptionsService zcEbOptionsService) {    this.zcEbOptionsService = zcEbOptionsService;  }  public List getZcEbProtocolList(ElementConditionDto dto, RequestMeta meta) {    return zcEbOptionsService.getZcEbProtocolList(dto, meta);  }  public String getZcEbFileId(ElementConditionDto dto, RequestMeta meta) {    return zcEbOptionsService.getZcEbFileId(dto);  }  public ZcEbOptions save(ZcEbOptions zcEbOptions, RequestMeta requestMeta) {    return zcEbOptionsService.save(zcEbOptions, requestMeta);  }  public void update(ZcEbOptions zcEbOptions, RequestMeta requestMeta) {    zcEbOptionsService.update(zcEbOptions);  }  public void delete(String protCode, RequestMeta requestMeta) {    zcEbOptionsService.delete(protCode);  }  public int isExistsFileCode(ElementConditionDto dto, RequestMeta meta) {    return zcEbOptionsService.isExistsFileCode(dto);  }  public String getFileCode(ElementConditionDto dto, RequestMeta meta) {    return zcEbOptionsService.getFileCode(dto);  }}